/*Table structure for table `mls_user` */

DROP TABLE IF EXISTS `mls_user`;

CREATE TABLE `mls_user` (
  `MLS_USER_ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '分销用户ID',
  `USER_NAME` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户名',
  `NICKNAME` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '昵称',
  `LOGIN_NAME` varchar(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '登录名手机号+设备号',
  `LOGIN_PASSWORD` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '登录密码-用户Id',
  `DEVICE_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '设备编号',
  `USER_TEL` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '电话',
  `PROFILE_PHOTO` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '头像',
  `ALL_SALES` int(11) DEFAULT '0' COMMENT '总销售额-单位分',
  `TODAY_SALES` int(11) DEFAULT '0' COMMENT '今天销售额-单位分',
  `ALL_PROFIT` int(11) DEFAULT '0' COMMENT '总分润-单位分',
  `GET_PROFIT` int(11) DEFAULT '0' COMMENT '可提现分润-单位分',
  `FATHER_USER_ID` int(11) DEFAULT NULL COMMENT '父用户ID',
  `SON_USER_SUM` int(11) DEFAULT NULL COMMENT '子用户数量',
  `C_TIME` datetime NOT NULL COMMENT '创建时间',
  `FX` double(5,2) DEFAULT NULL COMMENT '本人分佣金',
  `FX1` double(5,2) DEFAULT NULL COMMENT '一级分佣金',
  `FX2` double(5,2) DEFAULT NULL COMMENT '二级分佣金',
  `PFX` double(5,2) DEFAULT NULL COMMENT '平台分佣金',
  `merchant_id` bigint(20) DEFAULT NULL COMMENT '商户id',
  `FID` int(11) DEFAULT NULL COMMENT '父节点',
  `ROOT_ID` int(11) DEFAULT NULL COMMENT '分销用户根节点',
  `all_show` int(11) DEFAULT '0' COMMENT '是否显示其他商户 0:不显示，1:显示',
  `USER_ID` int(11) DEFAULT NULL COMMENT '用户ID',
  PRIMARY KEY (`MLS_USER_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=73 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='分销用户';

