/*Table structure for table `nideshop_order` */

DROP TABLE IF EXISTS `nideshop_order`;

CREATE TABLE `nideshop_order` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '',
  `user_id` mediumint(8) unsigned DEFAULT '0',
  `order_status` int(3) unsigned DEFAULT '0' COMMENT '订单状态:101订单已取消,102订单已删除,201订单已付款,等待发货,300订单已发货,301用户确认收货,401 没有发货退款,402 已收货退款退货',
  `shipping_status` tinyint(1) unsigned DEFAULT '0' COMMENT '发货状态 商品配送情况;0未发货,1已发货,2已收货,4退货',
  `pay_status` tinyint(1) unsigned DEFAULT '0' COMMENT '付款状态 支付状态;0未付款;1付款中;2已付款;4退款',
  `consignee` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '' COMMENT '收货人',
  `country` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '国家',
  `province` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '省',
  `city` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '市',
  `district` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '街道',
  `address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '' COMMENT '地址',
  `mobile` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '' COMMENT '收货手机',
  `postscript` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '' COMMENT '补充说明',
  `shipping_id` tinyint(3) DEFAULT '0' COMMENT '快递公司Id',
  `shipping_name` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '' COMMENT '快递公司名称',
  `pay_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '付款',
  `pay_name` varchar(120) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '',
  `shipping_fee` decimal(10,2) DEFAULT '0.00' COMMENT '快递费用',
  `actual_price` decimal(10,2) DEFAULT '0.00' COMMENT '实际需要支付的金额',
  `integral` int(10) unsigned DEFAULT '0' COMMENT '积分',
  `integral_money` decimal(10,2) DEFAULT '0.00' COMMENT '积分抵扣金额',
  `order_price` decimal(10,2) DEFAULT '0.00' COMMENT '订单总价',
  `goods_price` decimal(10,2) DEFAULT '0.00' COMMENT '商品总价',
  `add_time` datetime DEFAULT NULL COMMENT '新增时间',
  `confirm_time` datetime DEFAULT NULL COMMENT '确认时间',
  `pay_time` datetime DEFAULT NULL COMMENT '付款时间',
  `freight_price` int(10) unsigned DEFAULT '0' COMMENT '配送费用',
  `coupon_id` mediumint(8) unsigned DEFAULT '0' COMMENT '使用的优惠券id',
  `parent_id` mediumint(8) unsigned DEFAULT '0',
  `coupon_price` decimal(10,2) DEFAULT NULL COMMENT '优惠价格',
  `callback_status` enum('true','false') CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT 'true' COMMENT '支付回调状态',
  `shipping_no` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '快递号单号',
  `full_cut_price` decimal(10,2) DEFAULT NULL COMMENT '订单满减金额',
  `order_type` varchar(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '1购物车、2普通、3秒杀、4团购',
  `brand_id` int(11) DEFAULT NULL COMMENT '品牌Id',
  `settlement_total_fee` int(11) DEFAULT NULL COMMENT '单位分 应结订单金额 扣除手续后 到账金额',
  `all_price` decimal(10,2) DEFAULT NULL COMMENT '总付款金额',
  `all_order_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '总订单ID',
  `promoter_id` int(11) DEFAULT NULL COMMENT '推荐人id',
