/*Table structure for table `nideshop_product` */

DROP TABLE IF EXISTS `nideshop_product`;

CREATE TABLE `nideshop_product` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `goods_id` mediumint(8) unsigned DEFAULT '0' COMMENT '商品Id',
  `goods_specification_ids` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '商品规格ids',
  `goods_sn` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '商品序列号',
  `goods_number` mediumint(8) unsigned DEFAULT '0' COMMENT '商品编码',
  `retail_price` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '零售价格',
  `market_price` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '价格',
  `merchant_id` bigint(20) DEFAULT NULL COMMENT '商户ID',
  `group_price` decimal(10,2) DEFAULT NULL COMMENT '团购价格 元',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=400 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

