CREATE TABLE `nideshop_user` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `password` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '',
  `gender` tinyint(1) DEFAULT NULL,
  `birthday` datetime DEFAULT NULL,
  `register_time` datetime DEFAULT NULL,
  `last_login_time` datetime DEFAULT NULL,
  `last_login_ip` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '',
  `user_level_id` tinyint(3) DEFAULT NULL,
  `nickname` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '',
  `mobile` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '',
  `register_ip` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '',
  `avatar` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '',
  `weixin_openid` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '',
  `get_money` decimal(10,2) DEFAULT '0.00' COMMENT '可用抽奖金额',
  `get_num` int(11) DEFAULT '0' COMMENT '抽奖次数',
  `brand_id` int(11) DEFAULT NULL,
  `parent_user_id` int(11) DEFAULT NULL COMMENT '推荐人ID',
  `id_card` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '身份证号码',
  `promoter_id` int(11) DEFAULT NULL COMMENT '推广人id',
  `promoter_name` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '推广人姓名',
  `is_real` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '1' COMMENT '是否实名认证 1：否 2：是',
  `is_return_cash` int(1) DEFAULT '0' COMMENT '是否推荐购买返现 0没有、1已返现',
  `first_buy_money` decimal(10,0) DEFAULT NULL COMMENT '首次购买金额',
  `qr_code` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '二维码路径',
  `real_name` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '真实姓名',
  `total_brokerage` decimal(10,0) DEFAULT '0' COMMENT '总佣金',
  `valid_brokerage` decimal(10,0) DEFAULT '0' COMMENT '可提现金额',
  `withdraw_cash` decimal(10,0) DEFAULT '0' COMMENT '已提现金额',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_name` (`username`)
) ENGINE=InnoDB AUTO_INCREMENT=123 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

