/*Table structure for table `user_record` */

DROP TABLE IF EXISTS `user_record`;

CREATE TABLE `user_record` (
  `REPORT_ID` int(11) NOT NULL AUTO_INCREMENT,
  `MLS_USER_ID` int(11) DEFAULT NULL COMMENT '分销用户ID',
  `TYPES` int(11) DEFAULT NULL COMMENT '记录类型：1提现、2交易分成、3退回分润',
  `TYPES_STR` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '记录类型内容',
  `PRICE` int(11) DEFAULT NULL COMMENT '金额单位分',
  `REMARKS` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '备注',
  `C_TIME` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `ORDER_ID` int(11) DEFAULT NULL COMMENT '订单ID',
  PRIMARY KEY (`REPORT_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=139 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

